@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  public title:string = 'Hola Mundo';
  public counter:number = 10;
}
<h1>{{title}}</h1>
<hr>
<h3>{{counter}}
</h3>
